                    <Route path="/" element={<Home />} />
                    {/*<Route path="post">
                        <Route path=":id" element={<PostSolo />} />
    </Route>*/}
                </Route>
            </Routes>
        </BrowserRouter>
    )
}

export default RoutesTree
